#include <iostream>
#include <queue>
#include <vector>
#include <string>
using namespace std;
class Solution {
	struct MPoint{
		int x, y;
		MPoint(int _x, int _y):x(_x), y(_y){}
	};
private:
	void grow(vector<vector<char> > &board, vector<vector<bool> > &deal_map, queue<MPoint> &points_queue){
		if (points_queue.size() == 0)return;
		MPoint point = points_queue.front();
		points_queue.pop();
		if (point.y >= board.size() || point.y < 0 || point.x >= board[0].size() || point.x < 0 ||
			board[point.y][point.x] != 'O' || deal_map[point.y][point.x] == true){
				grow(board, deal_map, points_queue);
				return;}
		deal_map[point.y][point.x] = true;
		if (point.x > 0 && deal_map[point.y][point.x - 1] == false && board[point.y][point.x - 1] == 'O')points_queue.push(MPoint(point.x - 1, point.y));
		if (point.x + 1 < board[0].size()  && deal_map[point.y][point.x + 1] == false && board[point.y][point.x + 1] == 'O')points_queue.push(MPoint(point.x + 1, point.y));
		if (point.y > 0 && deal_map[point.y - 1][point.x] == false && board[point.y - 1][point.x] == 'O')points_queue.push(MPoint(point.x, point.y - 1));
		if (point.y + 1 < board.size()  && deal_map[point.y + 1][point.x] == false && board[point.y + 1][point.x] == 'O')points_queue.push(MPoint(point.x, point.y + 1));
		grow(board, deal_map, points_queue);
	}
	void set_board_by_map(vector<vector<char> > &board, vector<vector<bool> > &deal_map){
		for (int i = 0; i < board.size(); ++ i){
			for (int j = 0; j < board[0].size(); ++ j){
				board[i][j] = (deal_map[i][j] ? 'O' : 'X');
			}
		}
	}
	void deal_board(vector<vector<char> > &board, vector<vector<bool> > &deal_map){
		queue<MPoint> points_queue;
		for (int i = 0; i < board.size(); ++ i){
			if (board[i][0] == 'O')points_queue.push(MPoint(0, i));
			if (board[0].size() > 1 && board[i][board[0].size() - 1] == 'O') points_queue.push(MPoint(board[0].size() - 1, i));
		}
		for (int i = 0; i < board[0].size(); ++ i){
			if (board[0][i] == 'O')points_queue.push(MPoint(i, 0));
			if (board.size() > 1 && board[board.size() - 1][i] == 'O')points_queue.push(MPoint(i, board.size() - 1));
		}
		grow(board, deal_map, points_queue);
		set_board_by_map(board, deal_map);
	}
public:
	void solve(vector<vector<char> > &board) {
		if (0 == board.size()  || 0 == board[0].size())return;
		vector<bool> deal_map_line(board[0].size(), false);
		vector<vector<bool> > deal_map(board.size(), deal_map_line);
		deal_board(board, deal_map);
	}
};

